import React from 'react';
import Section from '../Section';
import ProgressBar from '../ProgressBar';
import Headline from '../Headline';
import styles from './Skills.module.scss';

const { heading, h3, flexWrapper, progressBars } = styles;

const Skills = () => {
  return (
    <Section tall>
      <Headline headline="Skills" />
      <div className={flexWrapper}>
        <div className={progressBars}>
          <h3 className={h3}>Programming Languages</h3>
          <ProgressBar title="JavaScript" width={90} advanced />
          <ProgressBar title="HTML" width={90} advanced />
          <ProgressBar
            title="CSS, SCSS, LESS, CSS Modules"
            width={90}
            advanced
          />
          <ProgressBar title="Typescript" width={80} intermediate />
          <ProgressBar title="Java" width={75} intermediate />
          <ProgressBar title="Python" width={60} basic />
          <ProgressBar title="C/C++" width={50} basic />
          <ProgressBar title="SQL/PostgreSQL" width={50} basic />
        </div>
        <div className={progressBars}>
          <h3 className={h3}>Frameworks / Software</h3>
          <ProgressBar title="React.js with Redux" width={90} advanced />
          <ProgressBar title="Next.js" width={80} intermediate />
          <ProgressBar title="React Native" width={75} intermediate />
          <ProgressBar title="Express" width={75} intermediate />
          <ProgressBar
            title="Google Analytics and Tag Manager"
            width={75}
            intermediate
          />
          <ProgressBar title="Bugsnag" width={70} basic />
          <ProgressBar title="Contentful" width={70} basic />
          <ProgressBar title="Cypress" width={60} basic />
        </div>
      </div>
    </Section>
  );
};

export default Skills;
